import React, { useState } from 'react'
import { handleError, handleSuccess } from '../../../../utils/utils';
import { ToastContainer } from 'react-toastify';
import { useNavigate } from 'react-router-dom';
import styles from './CementOrder.module.css';
import Navbar from '../../../../components/navbar/Navbar';
import Footer from '../../../../components/footer/Footer';

function CementOrder() {
    const [inputValue, setInputValue] = useState({
        supplierName: '',
        amountOfCement: ''
    });
    const navigate = useNavigate();

    const handleLogout = (e) => {
        localStorage.removeItem('token');
        localStorage.removeItem('role');
        handleSuccess('User Loggedout');
        setTimeout(() => {
            navigate('/company-login');
        }, 1000)
    }

    const handleChange = (e) => {
        const value = e.target.value;

        // Reject input of just a dot
        if (value === ".") {
            handleError("Dots alone are not acceptable input");
            return; // Stop further execution
        } 
        // Check for invalid characters
        else if (/[^0-9.]/.test(value)) {
            handleError("Positive numbers only! Letters are not allowed");
            setInputValue(""); // Clear input
        } 
        // Check for more than one dot
        else if ((value.match(/\./g) || []).length > 1) {
            handleError("Please ensure the input contains at most one decimal point");
            setInputValue(""); // Clear input
        } 
        // Check for decimal places exceeding one digit
        else if (value.includes(".")) {
            const decimalPlaces = value.split(".")[1];
            if (decimalPlaces && decimalPlaces.length > 1) {
                handleError("Ensure the number contains only one digit after the decimal point");
                setInputValue(""); // Clear input
            } else {
                setInputValue(value); // Update input value
            }
        } 
        // If all checks pass
        else {
            setInputValue(value); // Update input value
        }
    };

    const handleCheckout = (e) => {
        e.preventDefault();
        
        // Check if the input field is empty
        if (!inputValue.amountOfCement ) {
            handleError("Please enter quantity");
            return;
        }

        setTimeout(() => { 
            navigate(`/company/home/cement-order/cement-bill?value=${inputValue.amountOfCement}`) // (function) سيتم تنفيذها بعد انتهاء الوقت
        }, 1000)
    }
    
    return(
        <section className={styles.profileBody}>
            <Navbar 
                one="Home"
                pathOne="/company/home"
                two="Orders"
                two1="Under preparing orders"
                pathTwo1="/company/home/under-preparing-orders"
                two2="Pending orders"
                pathTwo2="/company/home/pending-orders"
                two3="Old orders"
                pathTwo3="/company/home/old-orders"
                three="Cement"
                pathThree="/company/home/cement-order"
                four="Concrete"
                pathFour="/company/home/concrete-order"
                five="Profile"
                pathFive="/company/home/profile"
                logout={handleLogout}
            />

            <div className={styles.cementOrderContainer}>
                <div className={styles.cementOrderRow}>
                    <h1 className={styles.cementOrderH1}>Cement Order</h1>
                    <form className={styles.cementOrderForm} onSubmit= {handleCheckout}>
                        <div className={styles.scementOrderDiv}>
                            <label className={styles.cementOrderLabel} htmlFor='supplierName'>Supplier Product</label>
                            <select
                                className={styles.cementOrderSelect}
                                name="supplierName" 
                                onChange={handleChange}
                                value={inputValue.supplierName} 
                            >
                                <option value="">Select an option</option>
                                <option value="Concrete">Concrete</option>
                                <option value="Cement">Cement</option>
                            </select>
                        </div>
                        <div className={styles.cementOrderDiv}>
                            <label className={styles.cementOrderLabel} htmlFor='amountOfCement'>Enter the required amount of cement in tons</label>
                            <input
                                className={styles.cementOrderInput}
                                onChange= {handleChange}
                                type='text'
                                name='amountOfCement' 
                                placeholder='Enter the required amount of cement in tons...'
                                value={inputValue.amountOfCement}
                                autoFocus
                            />
                        </div>
                        <div className={styles.cementOrderDiv}>
                            <p className={styles.cementOrderP}>20 bags of cement equals 1 tons</p>
                        </div>
                        <button className={styles.cementOrderButton} type='submit'>checkout</button>
                    </form>
                </div>
            </div>

            <Footer 
                one="Home"
                pathOne="/company/home"
                two="Orders"
                two1="Under preparing orders"
                pathTwo1="/company/home/under-preparing-orders"
                two2="Pending orders"
                pathTwo2="/company/home/pending-orders"
                two3="Old orders"
                pathTwo3="/company/home/old-orders"
                three="Cement"
                pathThree="/company/home/cement-order"
                four="Concrete"
                pathFour="/company/home/concrete-order"
                five="Profile"
                pathFive="/company/home/profile"
                logout={handleLogout}
            />
            <ToastContainer />
        </section>
    );
}
export default CementOrder;
